column30:
File export trả về:

HT: Thông tin các trường Tác động + Loại dịch vụ + Gói cước + Ngày hiệu lực + Ngày hết hạn + Cửa hàng + Nhân viên + Trạng thái + Ngày cập nhật chưa chính xác

MM: Thông tin chính xác:
- Tác động:  select action_code || ' - ' || name from action a where action_code = (select action_code from MAP_BUSINESS_SKIP_DEBT where map_id = :map_id);   
- Loại dịch vụ: select telecom_service_id || ' - ' || name from telecom_service t where telecom_service_id = (select telecom_service_id from MAP_BUSINESS_SKIP_DEBT where map_id = :map_id); 
-  Gói cước: Select decode(product_code,'-1','Tất cả', product_code) from MAP_BUSINESS_SKIP_DEBT where map_id = :map_id;
- Ngày hiệu lực: Định dạng: dd/mm/yyyy (k hiển thị giờ phút giây)
- Ngày hết hạn: Định dạng: dd/mm/yyyy (k hiển thị giờ phút giây)
- Cửa hàng: select shop_code || ' - ' || name from shop where shop_id = (select shop_id from MAP_BUSINESS_SKIP_DEBT where map_id = :map_id);
- Nhân viên: select staff_code|| ' - ' || name from staff where staff_id = (select staff_id from MAP_BUSINESS_SKIP_DEBT where map_id = :map_id);
- Trạng thái: Hiệu lực/ Không hiệu lực
- Ngày cập nhật: Định dạng: dd/mm/yyyy (k hiển thị giờ phút giây)

